(1, 1, '2015-01-18 00:03:47', '2015-01-18 00:03:47', 'Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!', 'Hello world!', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2015-01-18 00:03:47', '2015-01-18 00:03:47', '', 0, 'http://localhost/wedding/obscure/?p=1', 0, 'post', '', 1),
(35, 1, '2017-07-29 06:57:50', '2017-07-29 06:57:50', '  <ul class=\"nav nav-tabs\" role=\"tablist\">\n    <li role=\"presentation\" class=\"active\"><a href=\"#info\" aria-controls=\"info\" role=\"tab\" data-toggle=\"tab\">Information</a></li>\n    <li role=\"presentation\"><a href=\"#accommodations\" aria-controls=\"accommodations\" role=\"tab\" data-toggle=\"tab\">Accommodations</a></li>\n    <li role=\"presentation\"><a href=\"#registry\" aria-controls=\"registry\" role=\"tab\" data-toggle=\"tab\">Registry</a></li>\n  </ul>\n  <div class=\"tab-content\">\n<div role=\"tabpanel\" class=\"tab-pane active\" id=\"info\">\n<div class=\"left\">\n<div class=\"col-sm-6\">\n<p>Gerine Coronoado and Brent Braun are getting hitched on Friday November 11, 2017. The ceremony will held at <a href=\"http://www.thethursdayclub.org\" target=\"_blank\">Rancho Bernardo Country Club</a> in Rancho Bernardo, CA. at 4pm in the evening. The reception will follow immediately there after in the same location and go until 10pm. There will be food and drinks, and be sure to bring your dancing shoes!</p>\n<p><strong>For Directions to the Venue Click on the Map</strong></p>\n</div>\n</div>\n<div class=\"right\">\n<div class=\"col-sm-6\">\n<img src=\"http://localhost/wedding/obscure/media/rancho_venue-1024x832.png\" alt=\"\" width=\"1024\" height=\"832\" class=\"alignnone size-large wp-image-72\" />\n<a href=\"http://www.ccofrb.com\" target=\"_blank\"><img src=\"http://localhost/wedding/obscure/media/rancho_venue-300x244.png\" alt=\"\" width=\"300\" height=\"244\" class=\"alignnone size-medium wp-image-72\" /></a>\n</div>\n</div>\n</div>\n<div role=\"tabpanel\" class=\"tab-pane\" id=\"accommodations\">\n<div class=\"left\">\n<div class=\"col-sm-4\">\n<p>There are plenty of hotels within 5 miles of both the Thursday Club and the San Diego Airport Lindbergh Field. A beautiful location to stay is on Shelter Island which is approximately 3 miles from the venue. This area boasts great dinner options such as the <a href=\"http://www.balihairestaurant.com/\" target=\"_blank\">Bali Hai</a>, <a href=\"http://www.theredsails.com/\" target=\"_blank\">The Red Sails Inn</a>, <a href=\"http://www.brigantine.com/\" target=\"_blank\">The Brigantine</a>, and finally <a href=\"http://umisushisandiego.com\" target=\"_blank\">Umi Sushi</a>. This area is also know for the breathtaking views across the bay of the downtown San Diego skyline.</p>\n</div>\n</div>\n<div class=\"right\">\n<div class=\"col-sm-8\">\n<ul class=\"list-of-hotels\">\n<div class=\"col-sm-6\">\n<li><strong>Best Western Island Palms</strong><br>\n<address>\n<p><a href=\"http://www.islandpalms.com/\" target=\"_blank\">2051 Shelter Island Dr<br>\nSan Diego, CA 92106</a></p>\n</address>\n<a href=\"tel:6192220561\">619-222-0561</a>\n</li>\n</div>\n<div class=\"col-sm-6\">\n<li>\n<strong>Kona Kai Hotel and Resort</strong><br>\n<address>\n<p><a href=\"http://www.resortkonakai.com/\" target=\"_blank\">1551 Shelter Island Dr<br>\nSan Diego, CA 92106</a></p>\n</address>\n<a href=\"tel:6192218000\">619-221-8000</a>\n</li>\n</div>\n<div class=\"col-sm-6\">\n<li>\n<strong>Humphrey\'s Half Moon Inn & Suites</strong><br>\n<address>\n<p><a href=\"http://www.halfmooninn.com/\" target=\"_blank\">2241 Shelter Island Dr<br>\nSan Diego, CA 92106</a></p>\n</address>\n<a href=\"tel:6192243577\">619-224-3577</a>\n</li>\n</div>\n<div class=\"col-sm-6\">\n<li>\n<strong>Bay Club Hotel & Marina</strong><br>\n<address>\n<p><a href=\"http://www.bayclubhotel.com/\" target=\"_blank\">2131 Shelter Island Drive<br>\nSan Diego, CA 92106</a></p>\n</address><br>\n<a href=\"tel:6192248888\">619-224-8888</a>\n</li>\n</div>\n</ul>\n</div>\n</div>\n</div>\n    <div role=\"tabpanel\" class=\"tab-pane\" id=\"registry\">\n<h3 class=\"us\">Gerine and Brent are registered at:</h3>\n<strong>HoneyFund</strong><br>\n<a href=\"http://honeyfund.com/wedding/gerineandbrent\" target=\"_blank\">honeyfund.com/wedding/gerineandbrent</a><br>\n\n<strong>Bed Bath and Beyond</strong><br>\n<a href=\"#\" target=\"_blank\">bedbathandbeyond.com</a><br>\n</div>\n  </div>', 'Home', '', 'inherit', 'open', 'open', '', '4-autosave-v1', '', '', '2017-07-29 06:57:50', '2017-07-29 06:57:50', '', 4, 'http://localhost/wedding/4-autosave-v1/', 0, 'revision', '', 0),
